import React from "react";

function Header() {
    return (
        <div>
            <nav className="py-2 bg-dark border-bottom" style={{ backgroundColor: "black" }}>
                <div className="container d-flex flex-wrap">
                    <ul className="nav me-auto">
                        <li className="nav-item"><a href="#" className="nav-link link-body-emphasis px-2 active" aria-current="page" style={{ color: "white" }}>Home</a></li>
                        <li className="nav-item"><a href="#" className="nav-link link-body-emphasis px-2" style={{ color: "white" }}>Features</a></li>
                        <li className="nav-item"><a href="#" className="nav-link link-body-emphasis px-2" style={{ color: "white" }}>Pricing</a></li>
                        <li className="nav-item"><a href="#" className="nav-link link-body-emphasis px-2" style={{ color: "white" }}>FAQs</a></li>
                        <li className="nav-item"><a href="#" className="nav-link link-body-emphasis px-2" style={{ color: "white" }}>About</a></li>
                    </ul>
                    <ul className="nav">
                        <li className="nav-item"><a href="#" className="nav-link link-body-emphasis px-2" style={{ color: "white" }}>Login</a></li>
                        <li className="nav-item"><a href="#" className="nav-link link-body-emphasis px-2" style={{ color: "white" }}>Sign up</a></li>
                    </ul>
                </div>
            </nav>
        </div>
    );
}

export default Header;
